import React from 'react'
import { Icon } from 'semantic-ui-react'

 const Contacts = () => {
    return (
        <div>
             <Icon loading name='spinner' />
             <Icon loading name='certificate' />
             <Icon loading name='asterisk' />
        </div>
    )
}

export default Contacts
